    public int largestMagicSquare(int[][] grid) {
        int r = grid.length;
        int c = grid[0].length;

        row = new int[r][c];
        col = new int[r][c];
        //首先计算前缀和，简化计算
        for (int i=0;i<r;i++)
        {
            row[i][0] = grid[i][0];
            for (int j=1;j<c;j++)
            {
                row[i][j] = row[i][j-1] + grid[i][j];
            }
        }
        for (int j = 0; j < c; j++) {
            col[0][j] = grid[0][j];
            for (int i = 1; i < r; i++) {
                col[i][j] = col[i-1][j] + grid[i][j];
            }
        }
        //从可能的最大方形矩阵开始逐个暴力遍历，然后尺寸逐渐缩小
        int n = Math.min(r,c);

        for(int k=n;k>=2;k--)
        {
            for (int i=0;i<=r-k;i++)
            {
                for (int j=0;j<=c-k;j++)
                {
                    if (checkCount(i,j,k,grid))
                        return k;
                }
            }
        }

        return 1;
    }
    public boolean checkCount(int r, int c, int k, int[][] grid)
    {
//        System.out.println(k);
        //检查行
        int cur = row[r][c+k-1] - row[r][c] + grid[r][c];
        for (int i=r+1;i<r+k;i++)
        {
            if (cur != (row[i][c+k-1] - row[i][c] + grid[i][c]))
                return false;
        }
//        System.out.println("row");
        //检查列
        for (int j=c+1;j<c+k;j++)
        {
            if (cur != col[r+k-1][j] - col[r][j] + grid[r][j])
                return false;
        }
//        System.out.println("col");
        //检查对角线
        int cur2 = 0;

        for (int i=r,j=c;i<r+k;i++,j++)
            cur2 += grid[i][j];

        if (cur2 != cur)
            return false;
        cur2 = 0;
        for (int i=r,j=c+k-1;i<r+k;i++,j--)
            cur2 += grid[i][j];

        return cur == cur2;
    }

    public int chalkReplacer(int[] chalk, int k) {
        int len = chalk.length;

        int sum = 0;
        for (int i: chalk){
            sum += i;
            if (sum > k)
               break;
        }
        int c = k / sum;
        k = k-c*sum;
        for (int i=0;i<len;i++)
        {
            if (k<chalk[i])
                return i;
            else
                k -= chalk[i];
        }

        return 0;
    }

    public boolean isCovered(int[][] ranges, int left, int right) {
        int row = ranges.length;
        int col = ranges[0].length;

        int sign = 0;
        for (int i=left;i<=right;i++)
        {
            sign = 0;
            for (int j=0;j<row;j++)
            {
                if (i>=ranges[j][0] && i<= ranges[j][1])
                {
                    sign = 1;
                    break;
                }
            }
//            System.out.println(i);
            if (sign == 0)
                return false;
        }
        return true;
    }



    public int findMaxForm(String[] strs, int m, int n) {
        int len = strs.length;

        //最后判断满足条件的最大元素个数
        int[][][] dp = new int[len+1][m+1][n+1];

        for (int i=1;i<=len;i++)
        {
            int[] c = count_num(strs[i-1]);
            for (int j=0;j<=m;j++)
            {
                for (int k=0;k<=n;k++)
                {
                    dp[i][j][k] = dp[i-1][j][k];
                    if (c[0]<=j && c[1]<=k)
                        dp[i][j][k] = Math.max(dp[i][j][k], dp[i-1][j-c[0]][k-c[1]]+1);

                }
            }
        }





        return dp[len][m][n];
    }

    public int[] count_num(String str)
    {
        int[] a = new int[2];
        Arrays.fill(a,0);

        for (char ch : str.toCharArray())
        {
            if (ch == '1')
                a[1]++;
            else
                a[0]++;
        }
        return a;
    }

    public int lastStoneWeightII(int[] stones) {
        int len = stones.length;
        //借助目标和的思想，因为要求能达到的剩余石块的最小重量，所以可以把石头分为两堆，使用一堆的总重量减去另一堆的重量即为剩余的重量，
        //这里把两个堆设为A堆和B堆，其中A堆的重量大于等于B堆的重量
        //为了得到最小的剩余石头重量，两个堆的总重量应该尽可能的接近，最佳情况是相等。
        //此处首先获得最佳的情况（因为石料不可分割，所以这个值可能达不到，但这个是最佳情况）
        int sum = 0;
        for (int i: stones)
            sum += i;
        int t = sum / 2;

        //定义数组，第一个元素指的是参与计算的石块数量，第二个元素指的是当前条件下B堆可以达到的最大重量，如果可以达到，则是true，否则是false
        boolean [][] dp = new boolean[len+1][t+1];
        dp[0][0] = true;


        //从1块石头参与计算开始进行动态规划
        for (int i=1;i<=len;i++)
        {
            for (int j=0;j<=t;j++)
            {
                //如果当前B堆的最大重量大于当前石头的重量,存在两种情况-选或不选,选的话-dp[i-1][j-stones[i-1],不选-dp[i-1][j]
                //因为此时判断的是能不能达到j,所以两种情况有一个可以达到即为可以达到
                if (j>=stones[i-1])
                    dp[i][j] = dp[i-1][j] || dp[i-1][j-stones[i-1]];
                else
                    dp[i][j] = dp[i-1][j];
            }
        }

//        for (int i = 0;i<=len;i++)
//        {
//            for (int j=0;j<=t;j++)
//                System.out.print("\t"+dp[i][j] + " ");
//            System.out.println();
//        }

        //因为最后求的是B堆可以达到的最大重量,所以从理想情况开始向下遍历,寻找满足条件的最大值
        for (int j=t;j>=0;j--)
        {
            if (dp[len][j])
                return sum-2*j;
        }
        return 0;
    }
